            width: 400px;
            height: 300px;
            border: 2px solid #333;
            padding: 10px;
            overflow: auto;
        }
        table {
            width: 100%;
            border-collapse: separate;
            border-spacing: 5px;
        }
        th, td {
            padding: 10px;
            text-align: center;
            font-size: 14px;
            border: 1px solid #666;
